[{"location":"api/#API","page":"API","title":"API","text":"","category":"section"},{"location":"api/#MetidaBioeq.bioequivalence","page":"API","title":"MetidaBioeq.bioequivalence","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaBioeq.bioequivalence","category":"page"},{"location":"api/#MetidaBioeq.bioequivalence","page":"API","title":"MetidaBioeq.bioequivalence","text":"bioquivalence(data;\nvars = nothing,\nsubject = :subject,\nperiod = :period,\nformulation = :formulation,\nsequence = :sequence,\nstage = nothing,\nreference = nothing,\ndesign = nothing,\nio::IO = stdout,\nseqcheck = true,\ndropcheck = true,\nlogt = true)\n\nvars - variabel's column(s);\nsubject - subject's column;\nperiod - period's column;\nformulation - formulation's column;\nsequence -sequence's column;\nstage - stage's column;\nreference - reference value for formulation column;\ndesign - design: \"parallel\", \"2X2\", \"2X2X2\", \"2X2X4\", ets. (formulations X sequences X periods);\nseqcheck - check sequencs;     \ndropcheck - dropuot check;\nlogt - if true (default) data is already log-transformed, else log() will be used.\n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaBioeq.makeseq","page":"API","title":"MetidaBioeq.makeseq","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaBioeq.makeseq","category":"page"},{"location":"api/#MetidaBioeq.makeseq","page":"API","title":"MetidaBioeq.makeseq","text":"makeseq(data;\n    subject = :subject,\n    period = :period,\n    formulation = :formulation)\n\nMake sequence vector from data and subject, period, formulation columns.\n\n\n\n\n\n","category":"function"},{"location":"api/#MetidaBioeq.result","page":"API","title":"MetidaBioeq.result","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"MetidaBioeq.result","category":"page"},{"location":"api/#MetidaBioeq.result","page":"API","title":"MetidaBioeq.result","text":"result(be; estimator = \"auto\", method = \"auto\", supresswarn = false)\n\nmethod - Model settings.\n\nif method == \"auto\" than method A used for \"2X2\" and \"2X2X2\"  designes, method P for \"parallel\" design and method B for any other.\n\nMethods:\n\nA using GLM and model @formula(var ~ formulation + period + sequence + subject)\nB using MixedModels and model @formula(var ~ formulation + period + sequence + (1|subject)) or Metida and model @lmmformula(v ~ formulation + period + sequence, random = 1|subject:SI)\nC using Metida and model @lmmformula(v ~ formulation + period + sequence, random = formulation|subject:CSH, repeated = formulation|subject:DIAG)\nP using GLM and model @formula(var ~ formulation)\n\nestimator - Estimator settings.\n\nif estimator == \"auto\" than GLM used for \"parallel\" design; for \"2X2\" design used GLM if no droputs and MixedModels if dropout == true; for other designes with method C Metida used and MixedModel for other cases.\n\nEstimators:\n\n\"glm\" for GLM (https://juliastats.org/GLM.jl/stable/)\n\"mm\" for MixedModels (https://juliastats.org/MixedModels.jl/stable/)\n\"met\" for Metida (https://pharmcat.github.io/Metida.jl/stable/)\n\nOther autosettings:\n\nIf design is \"parallel\" estimator set as \"glm\" and method as \"P\".\n\nIf design is \"2X2\" and method is \"P\" or \"C\" than if estimator == \"glm\" method set as \"A\" and \"B\" for other estimators. \n\nIf design not \"parallel\" or \"2X2\": \n\nif method not \"A\", \"B\" or \"C\" than set as \"A\" for \"glm\" ann as B for other estimators;\n\nif estimator == \"glm\" and method == \"B\" than estimator set as \"mm\", if estimator == \"glm\" or \"mm\" and method == \"C\" than estimator set as \"met\".\n\nReference:\n\nEMA: GUIDELINE ON THE INVESTIGATION OF BIOEQUIVALENCE\n\nEMA: GUIDELINE ON THE INVESTIGATION OF BIOEQUIVALENCE, Annex I\n\n\n\n\n\n","category":"function"},{"location":"","page":"Home","title":"Home","text":"Bioequivalence is a term in pharmacokinetics used to assess the expected in vivo biological equivalence of two proprietary preparations of a drug. If two products are said to be bioequivalent it means that they would be expected to be, for all intents and purposes, the same.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Birkett (2003) defined bioequivalence by stating that, \"two pharmaceutical products are bioequivalent if they are pharmaceutically equivalent and their bioavailabilities (rate and extent of availability) after administration in the same molar dose are similar to such a degree that their effects, with respect to both efficacy and safety, can be expected to be essentially the same. Pharmaceutical equivalence implies the same amount of the same active substance(s), in the same dosage form, for the same route of administration and meeting the same or comparable standards.\"","category":"page"},{"location":"","page":"Home","title":"Home","text":"For The World Health Organization (WHO) \"two pharmaceutical products are bioequivalent if they are pharmaceutically equivalent or pharmaceutical alternatives, and their bioavailabilities, in terms of rate (Cmax and tmax) and extent of absorption (area under the curve), after administration of the same molar dose under the same conditions, are similar to such a degree that their effects can be expected to be essentially the same\".","category":"page"},{"location":"","page":"Home","title":"Home","text":"The United States Food and Drug Administration (FDA) has defined bioequivalence as, \"the absence of a significant difference in the rate and extent to which the active ingredient or active moiety in pharmaceutical equivalents or pharmaceutical alternatives becomes available at the site of drug action when administered at the same molar dose under similar conditions in an appropriately designed study.\"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Reference:","category":"page"},{"location":"","page":"Home","title":"Home","text":"https://www.ema.europa.eu/en/documents/other/31-annex-i-statistical-analysis-methods-compatible-ema-bioequivalence-guideline_en.pdf","category":"page"},{"location":"example/#Example","page":"Example","title":"Example","text":"","category":"section"},{"location":"example/","page":"Example","title":"Example","text":"using MetidaBioeq, CSV, DataFrames, CategoricalArrays;\n\nbedf2x2 = CSV.File(joinpath(dirname(pathof(MetidaBioeq)), \"..\", \"test\", \"csv\",  \"2x2rds1.csv\")) |> DataFrame\ntransform!(bedf2x2, :Subject => categorical, renamecols = false)\ntransform!(bedf2x2, :Period => categorical, renamecols = false)\nbedf2x2.logVar = log.(bedf2x2.Var)\n\nnothing; # hide","category":"page"},{"location":"example/#Data","page":"Example","title":"Data","text":"","category":"section"},{"location":"example/","page":"Example","title":"Example","text":"bedf2x2[1:5, :]","category":"page"},{"location":"example/#BE-object","page":"Example","title":"BE object","text":"","category":"section"},{"location":"example/","page":"Example","title":"Example","text":"    be2 = MetidaBioeq.bioequivalence(bedf2x2, \n    vars = :Var, \n    subject = :Subject, \n    formulation = :Formulation, \n    period = :Period,\n    sequence = :Sequence, \n    reference = \"R\",\n    design = \"2x2\",\n    autoseq = true,\n    logt = false)","category":"page"},{"location":"example/#Estimation","page":"Example","title":"Estimation","text":"","category":"section"},{"location":"example/#GLM","page":"Example","title":"GLM","text":"","category":"section"},{"location":"example/","page":"Example","title":"Example","text":"    beAglm  = MetidaBioeq.result(be2;  estimator = \"glm\", method = \"A\")","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"    beAglm.models[1]","category":"page"},{"location":"example/#MixedModels","page":"Example","title":"MixedModels","text":"","category":"section"},{"location":"example/","page":"Example","title":"Example","text":"    beBmm  = MetidaBioeq.result(be2;  estimator = \"mm\", method = \"B\")","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"    beBmm.models[1]","category":"page"},{"location":"example/#Metida","page":"Example","title":"Metida","text":"","category":"section"},{"location":"example/","page":"Example","title":"Example","text":"    beBmet  = MetidaBioeq.result(be2;  estimator = \"met\", method = \"B\")","category":"page"},{"location":"example/","page":"Example","title":"Example","text":"    beBmet.models[1]","category":"page"}]
